  },
  notes: {
    id: `${scope}.notes`,
    defaultMessage: 'Notes',
  },
  notesRequired: {
    id: `${scope}.notesRequired`,
    defaultMessage: 'Notes field is required.',
  },
  saleStatus: {
    id: `${scope}.saleStatus`,
    defaultMessage: 'Sale Status',
  },
  SelectSaleStatus: {
    id: `${scope}.SelectSaleStatus`,
    defaultMessage: 'Select sale status',
